INSERT INTO `ntrenz_cms_page` (`page_id`, `title`, `root_template`, `meta_keywords`, `meta_description`, `identifier`, `content_heading`, `content`, `creation_time`, `update_time`, `is_active`, `sort_order`, `layout_update_xml`, `custom_theme`, `custom_root_template`, `custom_layout_update_xml`, `custom_theme_from`, `custom_theme_to`) VALUES
(1, '404 Not Found 1', 'two_columns_right', 'Page keywords', 'Page description', 'no-route', NULL, '\n<div class="page-title"><h1>Whoops, our bad...</h1></div>\n<dl>\n    <dt>The page you requested was not found, and we have a fine guess why.</dt>\n    <dd>\n        <ul class="disc">\n            <li>If you typed the URL directly, please make sure the spelling is correct.</li>\n            <li>If you clicked on a link to get here, the link is outdated.</li>\n        </ul>\n    </dd>\n</dl>\n<dl>\n    <dt>What can you do?</dt>\n    <dd>Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd>\n    <dd>\n        <ul class="disc">\n            <li><a href="#" onclick="history.go(-1); return false;">Go back</a> to the previous page.</li>\n            <li>Use the search bar at the top of the page to search for your products.</li>\n            <li>Follow these links to get you back on track!<br /><a href="{{store url=""}}">Store Home</a>\n            <span class="separator">|</span> <a href="{{store url="customer/account"}}">My Account</a></li>\n        </ul>\n    </dd>\n</dl>\n', '2016-02-04 10:19:01', '2016-02-04 10:19:01', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 'Craftlifestyle Online Shop', 'one_column', NULL, NULL, 'home', NULL, '<div class="row">\r\n<div class="col-sm-6"><a href="#"><img class="img-responsive" alt="" src="{{skin url=''images/b1.jpg''}}" /></a></div>\r\n<div class="col-sm-6"><a href="#"><img class="img-responsive" alt="" src="{{skin url=''images/b2.jpg''}}" /></a></div>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class="row">\r\n<div class="col-sm-6"><a href="#"><img class="img-responsive" alt="" src="{{skin url=''images/b3.jpg''}}" /></a></div>\r\n<div class="col-sm-6"><a href="#"><img class="img-responsive" alt="" src="{{skin url=''images/b4.jpg''}}" /></a></div>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class="row">\r\n<div class="col-sm-2">\r\n<div class="home-category-link-div">\r\n<h3>Mens Items</h3>\r\n<span>{{block type="catalog/product_list" template="catalog/product/mens_items.phtml"}}</span></div>\r\n</div>\r\n<div class="col-sm-10"><span>{{block type="catalog/product_list" category_id="3" template="catalog/product/cat_product_list.phtml"}}</span></div>\r\n</div>\r\n<!--\r\n<p>&nbsp;</p>\r\n<div class="row">\r\n<div class="col-sm-2">\r\n<div class="home-category-link-div">\r\n<h3>Womens Items</h3>\r\n<span>{{block type="catalog/product_list" template="catalog/product/womens_items.phtml"}}</span></div>\r\n</div>\r\n<div class="col-sm-10"><span>{{block type="catalog/product_list" category_id="4" template="catalog/product/cat_product_list.phtml"}}</span></div>\r\n</div>-->', '2016-02-04 10:19:01', '2016-04-04 05:46:18', 1, 0, '<!--<reference name="content">\r\n        <block type="catalog/product_new" name="home.catalog.product.new" alias="product_new" template="catalog/product/new.phtml" after="cms_page">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type="reports/product_viewed" name="home.reports.product.viewed" alias="product_viewed" template="reports/home_product_viewed.phtml" after="product_new">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type="reports/product_compared" name="home.reports.product.compared" template="reports/home_product_compared.phtml" after="product_viewed">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n    </reference>\r\n    <reference name="right">\r\n        <action method="unsetChild"><alias>right.reports.product.viewed</alias></action>\r\n        <action method="unsetChild"><alias>right.reports.product.compared</alias></action>\r\n    </reference>-->', NULL, NULL, NULL, NULL, NULL),
